import React from 'react';
import './App.css';

import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="bodyWrapper">
        <div className="div1"></div>
        <div className="div2"></div>
      </div>
    </div>
  );
}

export default App;
